    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Wichita Mountains National Wildlife Refuge for
    the next 15 years. This plan outlines the Refuge vision and purpose and describes
    how the Refuge will contribute to the overall mission of the Refuge System. The
    plan provides an introduction to the Refuge, an overview of the CCP planning process,
    information about the environment, a summary of Refuge resources, goals and objectives,
    information about the management direction, current management programs, strategies
    for implementation, and a description of Refuge biology and habitats.",nt"license_title":
